import Api from './Api';

function loadDataProduct() {
  Api.get("http://127.0.0.1:8000/getAllCategory", {limit: 10, start: 0})
      .then((rs) => {
        this.setState({cateList: rs.Data});
        return rs.categories;
      });
}

let _cate = loadDataProduct();
console.log(_cate);
